import React from 'react';
import './App.css';
import background from './img/BackgroundPink.jpg';

function App() {
  return (
    <div className="App">
      <header className="App-header">

      </header>
      <body>
        <div className="Top">
          <img src={background} alt="Background Pink" />
        </div>

      </body>
    </div>
  );
}

export default App;
